fields.description:
Impakt Imobiliare Elite va propune spre inchiriere o casa tip Duplex cu 26 mp terase private, gradina si curte cu gazon/dale/pietris + acces la terasa de 40 mp, situata in cartierul Gruia!
Casa e situata intr-un complex rezidential linistit cu acces restrans.
Proprietatea este dispusa pe 2 niveluri P+E, dispune de 120 mp utili si are urmatoarea compartimentare:
Parter: Living + dinning cu bucatarie complet utilata cu electrocasnice Bosch baie, hol, debara, pivnita si iesire in gradina;
Etaj: Dormitor matrimonial cu terasa de 14 mp, dressing mobilat si baie de 6 mp deosebita;
dormitor copil (transformabil in birou) complet mobilat;
baie;
hol cu dulapuri incorporate.
Vedere panoramica.
Apartamentul se inchiriaza complet mobilat si utilat, cu mobila incorporata si utilari de foarte buna calitate fiind pregatit si utilizat in ultimul an de catre proprietar.
Imobilul este situat intr-o zona linistita a Clujului, aproape de mijloace de transport in comun si cu acces facil la centrul orasului. Exista posibiliate de parcare pentru maxim 3 masini (in curte si pe strada).
Pentru a afla mai multe detalii referitoare la aceasta casa deosebita va rugam sa ne contactati. Merita toata atentia Dvs.

